INSERT INTO `mt_mmb_website` VALUES ('55da4721cd7049e186a17745a795a6cd', '天美商行是一家拥有多年历史的大型食品供应企业。经营各类食品，有完善的种植、运输、仓储体系，符合国家最严格的安全标准。\n\n如果有任何需要，请第一时间联系我们，我们将竭诚为你服务。\n我们欢迎各界人士前来参观和洽谈业务。', null, 'tianmei', '/mmbhtml/tianmei.html', null);
