INSERT INTO `mt_mmb_website` VALUES ('c35e4315f7804f52b27e403a812deec6', '新美农场秉承高品质的理念，践行绿色生产、生态生产，提供最优质的农产品', null, '新美农场', '/mmbhtml/新美农场.html', null);
