INSERT INTO `mt_mmb_website` VALUES ('testschool001', '奥森学校是一所综合类大学，目前教职员工和在校学生1.7万人，拥有种类齐全的专业。\n并且和英国、澳大利亚、加拿大著名高校合作办学，可颁发得到这些国家教育部承认的学力证书。\n欢迎各地学子报考。', null, '奥森学校', '/mmbhtml/奥森学校.html', null);
INSERT INTO `mt_mmb_website` VALUES ('testshop001', '自2006年成立以来，公司一直秉承“品质、安全”的理念，为祖国人民提供高品质的食品，现已成为中国华北地区最大的食品连锁零售企业。长城商行从第一家门店起步，坚持研发高品质的产品，不断引进先进的经营管理思想，打造公司不可超越不可模仿的产品竞争力；注重对员工的培训和内部提拔，鼓励员工和公司共同成长，建立了一支优秀年轻有活力的管理团队，现公司正以超乎人们想象的速度快速发展，成为人们关注的焦点。\n目前，长城商行已发展至北京、天津、河北三个区域，已拥有15家专卖店，员工队伍已达200人。在新的一轮发展中，长城商行将一如既往的为祖国人民提供高品质的食品。', '自2006年成立以来，公司一直秉承“品质、安全”的理念，为祖国人民提供高品质的食品，现已成为中国华北地区最大的食品连锁零售企业。', '长城商行', '/mmbhtml/长城商行.html', '/upload/img/newImg/VU/min/9003f6f0471c4d298730d21425c9c4b8.jpg');
