INSERT INTO `rep_data_map` VALUES ('1', '会员常规信息', ' SELECT    DISTINCT   mmb.id, mmb.mmb_fname,mmb.mmb_engSname, mmb.mmb_sname, mmb.mmb_type, mmb.mmb_homePage,mmb.mmb_email,  mmb.mmb_phone,mmb.mmb_address,  mmb.mmb_areaId,mmb.mmb_status,  mmb.create_time  from mt_member mmb where 1 = 1      ', null, '2016-06-30 13:50:55');
INSERT INTO `rep_data_map` VALUES ('2', '会员销售统计', ' SELECT  DISTINCT  mmb.id, mmb.mmb_fname,mmb.mmb_engSname, mmb.mmb_sname, mmb.mmb_type, mmb.mmb_homePage,mmb.mmb_email,  mmb.mmb_phone,mmb.mmb_address,  mmb.mmb_areaId,mmb.mmb_status,  mmb.create_time  from mt_member mmb where 1 = 1 limit 0 ,20     ', null, '2016-06-30 13:50:55');
INSERT INTO `rep_data_map` VALUES ('3', '采购数据统计', 'SELECT DISTINCT\r\n	od.mbid,\r\n	od.mbname,\r\n	od.goods_name,\r\n	Count(od.m_count) m_count,\r\n	Sum(od.m_totalnum) m_totalnum,\r\n	Sum(od.m_totalmoney) m_totalmoney,\r\n	Sum(od.m_netpaynum) m_netpaynum\r\nFROM\r\n	dc_order od\r\nINNER JOIN mt_mmb_group_rela mg ON mg.mmb_id = od.mbid  where  1=1 ', null, null);
INSERT INTO `rep_data_map` VALUES ('4', '销售数据统计', 'SELECT DISTINCT\r\n	od.msid,\r\n	od.msname,\r\n	od.goods_name,\r\n	Count(od.m_count) m_count,\r\n	Sum(od.m_totalnum) m_totalnum,\r\n	Sum(od.m_totalmoney) m_totalmoney,\r\n	Sum(od.m_netgetpaynum) m_netgetpaynum\r\nFROM\r\n	dc_order od\r\n\r\nINNER JOIN mt_mmb_group_rela mg ON mg.mmb_id = od.msid  where  1=1 ', null, null);
INSERT INTO `rep_data_map` VALUES ('5', '商品采购统计', '\r\nSELECT DISTINCT\r\n	\r\n	od.goods_name,\r\n	MAX(od.m_pricemax) pricemax,\r\n	MIN(od.m_pricemin) pricemin,\r\n	Sum(od.m_totalnum) totalnum,\r\n	Count(od.mbid)  mbid\r\n	\r\n	\r\nFROM\r\n	dc_order od\r\n\r\nINNER JOIN mt_mmb_group_rela mg ON mg.mmb_id = od.msid  where  1=1 ', null, null);
