-- ----------------------------
-- View structure for in_out_view
-- ----------------------------
DROP VIEW IF EXISTS `in_out_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%`  VIEW `in_out_view` AS select sum(a.TRANSFER_AMT) as AMT,
a.OUT_ACCT AS AMT_ACCOUNT,
a.OUT_ACCT_COPY_NAME,
bk1.BANK_NAME
from fund_transfer_detail a
inner join bank bk1 on a.OUT_BANK_ID = bk1.BANK_ID
group by a.OUT_ACCT 
union all
select 0-sum(b.TRANSFER_AMT) as AMT,
b.IN_ACCT AS AMT_ACCOUNT,
b.OUT_ACCT_COPY_NAME,
bk2.BANK_NAME
from fund_transfer_detail b
inner join bank bk2 on b.OUT_BANK_ID = bk2.BANK_ID
group by b.IN_ACCT ; ;

-- ----------------------------
-- View structure for v_bank_acct_rule
-- ----------------------------
DROP VIEW IF EXISTS `v_bank_acct_rule`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%`  VIEW `v_bank_acct_rule` AS SELECT R1.bank_id zong_id,LENGTH(R1.RULE_END - R1.RULE_START + 1) zong_length,R1.rule_start zong_start,R1.rule_end zong_end,R1.rule_content zong_content,
R2.bank_id fen_id,LENGTH(R2.acct_length) fen_length,R2.rule_start fen_start,R2.rule_end fen_end,R2.rule_content fen_content,
R3.bank_id zhi_id,LENGTH(R3.acct_length) zhi_length,R3.rule_start zhi_start,R3.rule_end zhi_end,R3.rule_content zhi_content FROM bank_acct_rule  R1
LEFT JOIN
bank_acct_rule  R2
ON TRIM(R1.bank_id)=SUBSTR(R2.bank_id,1,4) AND LENGTH(TRIM(R1.bank_id))=4 and LENGTH(TRIM(R2.bank_id))=8
LEFT JOIN
bank_acct_rule  R3
ON TRIM(R2.bank_ID)=SUBSTR(R3.BANK_ID,1,8) AND LENGTH(TRIM(R3.bank_id))=12
WHERE LENGTH(TRIM(R1.bank_id))=4 ; ;

-- ----------------------------
-- View structure for v_bank_acct_rule2
-- ----------------------------
DROP VIEW IF EXISTS `v_bank_acct_rule2`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%`  VIEW `v_bank_acct_rule2` AS SELECT R1.bank_id zong_id,(R1.RULE_END - R1.RULE_START + 1) zong_length,R1.rule_start zong_start,R1.rule_end zong_end,R1.rule_content zong_content,
R2.bank_id fen_id,(R2.RULE_END - R2.RULE_START + 1) fen_length,R2.rule_start fen_start,R2.rule_end fen_end,R2.rule_content fen_content,
R3.bank_id zhi_id,(R3.RULE_END - R3.RULE_START + 1) zhi_length,R3.rule_start zhi_start,R3.rule_end zhi_end,R3.rule_content zhi_content FROM bank_acct_rule  R1
LEFT JOIN
bank_acct_rule  R2
ON TRIM(R1.bank_id)=SUBSTR(R2.bank_id,1,4) AND LENGTH(TRIM(R1.bank_id))=4 and LENGTH(TRIM(R2.bank_id))=8
LEFT JOIN
bank_acct_rule  R3
ON TRIM(R2.bank_ID)=SUBSTR(R3.BANK_ID,1,8) AND LENGTH(TRIM(R3.bank_id))=12
WHERE LENGTH(TRIM(R1.bank_id))=4 ;
